import { CDataTable } from "@coreui/react";
const Table = (props) => {
  return (
    <>
      <CTable responsive="md">
          <CTableHead>
              <CTableRow>
                  <CTableHeaderCell>
                      
                  </CTableHeaderCell>
              </CTableRow>
          </CTableHead>
      </CTable>
    </>
  );
};
export default Table;
